'''
给定一个二维网格 board 和一个字典中的单词列表 words，找出所有同时在二维网格和字典中出现的单词。

单词必须按照字母顺序，通过相邻的单元格内的字母构成，其中“相邻”单元格是那些水平相邻或垂直相邻的单元格。同一个单元格内的字母在一个单词中不允许被重复使用。

示例:

输入: 
words = ["oath","pea","eat","rain"] and board =
[
  ['o','a','a','n'],
  ['e','t','a','e'],
  ['i','h','k','r'],
  ['i','f','l','v']
]

输出: ["eat","oath"]
说明:
你可以假设所有输入都由小写字母 a-z 组成。

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/word-search-ii
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
'''


class Solution:
    def findWords(self, board: list, words: list) -> list:
        # findWords(self, board: List[List[str]], words: List[str]) -> List[str]:
        if len(board) == 0:
            return []
        if len(board[0]) == 0:
            return []
        if len(words) == 0:
            return []
        
        self.firstCharacter = {}
        for w in words:
            try:
                self.firstCharacter[w[0]].add(w)
            except:
                self.firstCharacter[w[0]] = set([w])
         
        self.m, self.n = len(board), len(board[0])
        self.board = board
        self.wordFound = set()
        self.memory = [set() for _ in range(self.m * self.n)]
    
    
        for i in range(len(board)):
            for j in range(len(board[i])):
                print(i, j)
                if board[i][j] in self.firstCharacter.keys() and len(self.firstCharacter[board[i][j]]) != 0:
                    self.wordIJ = set()
                    self.path = set()
                    self.path1 = []
                    self.word = ''
                    self.exploreGrid(i, j, self.firstCharacter[board[i][j]])
                    
                    self.firstCharacter[board[i][j]] = self.firstCharacter[board[i][j]].difference(self.wordIJ)
        return list(self.wordFound)

        
                    
                    
    def exploreGrid(self, i, j, repo):
        self.memory[i * self.n + j].add(self.word)
        print('add', i, j, self.word, self.path1)
        self.path.add((i, j))
        self.path1.append((i, j))
        self.word += self.board[i][j]
        repoNew = set()
        for word in repo:
            if  word[len(self.path) - 1] == self.board[i][j]:
                if len(word) >= len(self.path) + 1:
                    repoNew.add(word)
                else:
                    print(self.path1)
                    self.wordFound.add(word)
                    self.wordIJ.add(word)

        if len(repoNew) > 0:
            frontier = self.addFrontier(i, j)
            for f in frontier:
                if self.word not in self.memory[f[0] * self.n + f[1]]:
                    repoNew = self.exploreGrid(f[0], f[1], repoNew)
                else:
                    print('else',f[0], f[1], self.word, self.path1)
        self.path.remove((i, j))
        self.path1.pop()
        self.word = self.word[:-1]
        return repo.difference(self.wordIJ)
        
        
                
       
                    
    def addFrontier(self, i, j):
        frontier = set()
        if j + 1 < self.n and (i, j + 1) not in self.path:
            frontier.add((i, j + 1))
        if i - 1 >= 0 and (i - 1, j) not in self.path:
            frontier.add((i - 1, j))
        if i + 1 < self.m and (i + 1, j) not in self.path:
            frontier.add((i + 1, j))
        if j - 1 >= 0 and (i, j - 1) not in self.path:
            frontier.add((i, j - 1))
        
        return frontier
        
        
        
        
        
cl = Solution()       

